from random import randint

def make_correct_array(s):
    from itertools import accumulate

    s = map(ord, s)
    s = accumulate(s)

    return [x * 0x1337**7 for x in s]

def validate(a, xs):
    def poly(a, x):
        value = 0
        for ai in a:
            value *= x
            value += ai

        return value

    if len(a) != len(xs) +1:
        return False

    for x in xs:
        value = poly(a, x)

        if value != 0x1337**2:
            return False


    return True


